import React from "react";
import {
  BrowserRouter as Router,
  Route,
  useHistory,
  Link,
  withRouter
  // useLocation
} from "react-router-dom";
import PropTypes from "prop-types";
import List from "./list";

/**
 * @param {goBack} ËøîÂõû
 * @param {goForward} ÂâçËøõ
 * @param {titleObject} ÂõæÊ†áÊ†áÈ¢ò
 * @param {onClickTitle} ÁÇπÂáª‰∫ã‰ª∂
 * @returns
 */

import Breadcrumb from "./view";
// import Backbutton from "./Example5";

function BackButton() {
  let history = useHistory();
  // history.push("/li");
  return (
    <button type="button" onClick={() => history.push("/li")}>
      tiaozhaun
    </button>
  );
}

function BreadcrumbWrap(props) {
  let history = useHistory();
  // let location = useLocation();
  const { titleObject } = props;
  // let history = useHistory();

  const goBack = () => {
    history.goBack();
  };
  const goForward = () => {
    history.goForward();
  };
  const onClickTitle = item => {
    console.log(item);
    history.push("/li");
    // history.goBack();
  };
  return (
    <div>
      <Route>
        <Router>
          <Route>
            <Breadcrumb
              goback={goBack}
              goforword={goForward}
              titleObject={titleObject} //ÂΩìÂâçÊ∏≤ÊüìÈ°µÈù¢ËÆ∞ÂΩï (ÂåÖÊã¨icon titie)
              onClickTitle={() => history.push("/li")} //Ë∑≥ËΩ¨È°µÈù¢ÁÇπÂáª‰∫ã‰ª∂
            />
            <Link to="/">home </Link>
            <Link to="/li">list1 </Link>
            <Link to="/li2">list2 </Link>
            <List />
            {/* <button type="button" onClick={() => history.push("/li")}>
              ssss
            </button> */}
            {/* <BackButton /> */}

            <button type="button" onClick={() => history.goBack()}>
              tiaozhaun
            </button>
          </Route>
        </Router>
      </Route>
    </div>
  );
}
BreadcrumbWrap.protoTypes = {
  titleObject: PropTypes.object,
  onClickTitle: PropTypes.func
};
BreadcrumbWrap.defaultProps = {
  titleObject: [
    {
      icon: "üçâ",
      title: "ITÊäÄÊúØ"
    },
    {
      icon: "üçâ",
      title: "React"
    },

    {
      icon: "üçâ",
      title: "123"
    }
  ],
  onClickTitle: () => {
    console.log("clickTitle");
  }
};
export default withRouter(BreadcrumbWrap);
